Day 22 of #30DayMapChallenge: NULL

One of my pet peeves is the lack of downloadable postcodes boundaries in NZ. It's a fundamental part of our addressing system, and yet there's nothing official out there!

@nzpost, could we have this for a Christmas present? Pretty please? https://t.co/Yn7Sr5e7r5

